import "./App.css";
import Navbar from "./navbar.js";

function Contact() {
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <body>
        <div id="contactSect">
          <h3>Contact Us</h3>
          <p id="centerText">
            Have a question, comment, or complaint? We want to hear it! Email us
            anytime or call during our business hours: &nbsp;&nbsp;&nbsp; Monday
            through Friday, 9am to 5pm.
          </p>
        </div>
      </body>
    </div>
  );
}

export default Contact;
